sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var sap_price = inputs.sap_price;
  var sap_quantity = inputs.sap_quantity;

  var pros_price = inputs.pros_price;
  var pros_quantity = inputs.pros_quantity;

  var sap_temp = sap_price / sap_quantity;
  var pros_temp = pros_price / pros_quantity

  outputs.is_match = false;
  if (sap_temp == pros_temp){
      outputs.is_match=true;
  }

  outputs.delta = sap_temp - pros_temp;
  outputs.sap_each = sap_temp;
  outputs.pros_each = pros_temp;

})(inputs, outputs);

